    @media screen {
        #invoice-POS {
            width: 80mm;
            margin: 20px auto;
            border: 1px solid #ccc;
            padding: 10px;
            background-color: white;
        }

        .hidden-print {
            display: block;
        }
    }

    /* Print-specific styles */
    @media print {
        @page { margin: 0; }
       body { margin: 0.5cm; }

        * {
            -webkit-print-color-adjust: exact !important;
            print-color-adjust: exact !important;
        }

        body {
            margin: 0 !important;
            padding: 0 !important;
            font-family: Arial, sans-serif;
            background-color: white !important;
        }

